export interface Race {
  id: string;
  name: string;
  location: string;
  state: string;
  startDateTime: Date;
  year: number;
  description: string;
}

import { differenceInSeconds } from 'date-fns';

export interface RaceParticipant {
  id: string;
  raceId: string;
  riderId: string;
  startedRace: boolean;
  finishedRace: boolean;
  startDateTime: Date | null;
  endDateTime: Date | null;

  calculateCompletedRaceTimeInSeconds(): number;
}

export class RaceParticipantImpl implements RaceParticipant {
  id: string;
  raceId: string;
  riderId: string;
  startedRace: boolean;
  finishedRace: boolean;
  startDateTime: Date | null;
  endDateTime: Date | null;

  constructor(raceParticipant: RaceParticipant) {
    this.id = raceParticipant.id;
    this.raceId = raceParticipant.raceId;
    this.riderId = raceParticipant.riderId;
    this.startedRace = raceParticipant.startedRace;
    this.finishedRace = raceParticipant.finishedRace;
    this.startDateTime = raceParticipant.startDateTime;
    this.endDateTime = raceParticipant.endDateTime;
  }

  calculateCompletedRaceTimeInSeconds(): number {
    let result = 0;
    if (this.startDateTime && this.endDateTime) {
      result = differenceInSeconds(this.endDateTime, this.startDateTime);
    }
    return result;
  }
}

import { Gender } from './gender';

export interface Rider {
  id: string;
  givenName: string;
  surname: string;
  birthDate: Date;
  gender: Gender;

  calculateAgeToday(): number;
}

export class RiderImpl implements Rider {
  id: string;
  givenName: string;
  surname: string;
  birthDate: Date;
  gender: Gender;

  constructor(rider: Rider) {
    this.id = rider.id;
    this.givenName = rider.givenName;
    this.surname = rider.surname;
    this.birthDate = rider.birthDate;
    this.gender = rider.gender;
  }

  calculateAgeToday(): number {
    const today = new Date();
    const birthDate = new Date(this.birthDate);
    let age = today.getFullYear() - birthDate.getFullYear();
    const m = today.getMonth() - birthDate.getMonth();
    if (m < 0 || (m === 0 && today.getDate() < birthDate.getDate())) {
      age--;
    }
    return age;
  }
}

