import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import {
  RaceParticipant,
  RaceParticipantImpl,
} from '../types/race-participant';
import { map } from 'rxjs/operators';

@Injectable({
  providedIn: 'root',
})
export class RaceParticipantService {
  constructor(private httpClient: HttpClient) {}

  getRaceParticipantsByRace(raceId: string): Observable<RaceParticipant[]> {
    return this.httpClient
      .get<RaceParticipant[]>(`/api/raceParticipants?raceId=${raceId}`)
      .pipe(
        map((raceParticipants: RaceParticipant[]) => {
          return raceParticipants.map((raceParticipant: RaceParticipant) => {
            return new RaceParticipantImpl(raceParticipant);
          });
        })
      );
  }
}

import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { Race } from '../types/race';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root',
})
export class RaceService {
  constructor(private httpClient: HttpClient) {}

  getRaces(): Observable<Race[]> {
    return this.httpClient.get<Race[]>('/api/races');
  }

  getRace(id: string): Observable<Race> {
    return this.httpClient.get<Race>(`/api/races/${id}`);
  }
}

import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { Rider, RiderImpl } from '../types/rider';
import { map } from 'rxjs/operators';

@Injectable({
  providedIn: 'root',
})
export class RiderService {
  constructor(private httpClient: HttpClient) {}

  getRiders(): Observable<Rider[]> {
    return this.httpClient.get<Rider[]>('/api/riders').pipe(
      map((riders: Rider[]) => {
        return riders.map((rider: Rider) => {
          return new RiderImpl(rider);
        });
      })
    );
  }

  getRider(id: string): Observable<Rider> {
    return this.httpClient.get<Rider>(`/api/riders/${id}`).pipe(
      map((rider: Rider) => {
        return new RiderImpl(rider);
      })
    );
  }
}

